'''
    This file tests the upload_base64 endpoint function in the main.py file
    To run this file, you need to have the main.py file running in the background
    You can run the main.py file by running the following command in the terminal:
    python3 main.py
    Afterwards, you can run this file by running the following command in a new terminal:
    python3 test_upload.py
'''
import requests
import base64

def pad_base64(b64_string):
    # Pad the base64 string if its length is not a multiple of 4
    return b64_string + '=' * (-len(b64_string) % 4)

def test_upload_base64():
    # Manually input base64 string (example of a small PNG image)
    image_base64 = """
    data:image/png;base64,
    """

    # Remove any extra whitespace or newlines in the base64 string
    image_base64 = image_base64.replace("\n", "").replace(" ", "")

    # Pad the base64 string if needed
    image_base64 = pad_base64(image_base64)

    # Create the JSON payload to send to the FastAPI endpoint
    payload = {"image": image_base64}

    # Make the POST request to your FastAPI backend
    response = requests.post("http://127.0.0.1:8000/upload-base64/", json=payload)

    # Check if the request was successful and print the extracted text
    if response.status_code == 200:
        print("Extracted Text:", response.json().get("extracted_text"))
    else:
        print(f"Request failed with status code: {response.status_code}, Details: {response.text}")

if __name__ == "__main__":
    test_upload_base64()
